ga60(){return"A symbol of peace"},
ga6_(){return"Rio de Janeiro, Brazil"},
ga5M(){return"Brazil"},
ga5X(){return"A Perfect Union Between"},
ga5W(){return"Nature and Architecture"},
ga5Y(){return"The statue looms large on the landscape, but it hides as much as it reveals about the diverse religious life of Brazilians."},
ga5Z(){return"Thomas Tweed"},
ga5N(){return"The statue of Christ the Redeemer with open arms, a symbol of peace, was chosen."},
ga5O(){return"Construction took nine years, from 1922 to 1931, and cost the equivalent of US$250,000 (equivalent to $3,600,000 in 2020) and the monument opened on October 12, 1931."},
ga62(){return"\u201cThe Majestic Statue of Christ the Redeemer - Seven Wonders of the Modern World - See U in History.\u201d Youtube, uploaded by See U in History / Mythology."},
ga5V(){return"Map showing location of Christ the Redeemer in Rio de Janeiro, Brazil."},
ga5R(){return"The placement of a Christian monument on Mount Corcovado was first suggested in the mid-1850s to honor Princess Isabel, regent of Brazil and the daughter of Emperor Pedro II, but the project was not approved.\nIn 1889 the country became a republic, and owing to the separation of church and state the proposed statue was dismissed."},
ga5S(){return'The Catholic Circle of Rio made a second proposal for a landmark statue on the mountain in 1920. The group organized an event called Semana do Monumento ("Monument Week") to attract donations and collect signatures to support the building of the statue. The organization was motivated by what they perceived as "Godlessness" in the society.\nThe designs considered for the "Statue of the Christ" included a representation of the Christian cross, a statue of Jesus with a globe in his hands, and a pedestal symbolizing the world.'},
ga5P(){return"Artist Carlos Oswald and local engineer Heitor da Silva Costa designed the statue. French sculptor Paul Landowski created the work. In 1922, Landowski commissioned fellow Parisian Romanian sculptor Gheorghe Leonida, who studied sculpture at the Fine Arts Conservatory in Bucharest and in Italy."},
ga5Q(){return"A group of engineers and technicians studied Landowski's submissions and felt building the structure of reinforced concrete instead of steel was more suitable for the cross-shaped statue. The concrete making up the base was supplied from Limhamn, Sweden. The outer layers are soapstone, chosen for its enduring qualities and ease of use."},
ga5T(){return'Corcovado, which means "hunchback" in Portuguese, is a mountain in central Rio de Janeiro, Brazil. It is a 2,329 foot (710 m) granite peak located in the Tijuca Forest, a national park.'},
ga5U(){return"Corcovado hill lies just west of the city center but is wholly within the city limits and visible from great distances."},
ga5G(){return"Plans for the statue were first proposed by Pedro Maria Boss upon Mount Corcovado. This was never approved, however."},
ga5H(){return"A new plan was proposed by the Roman Catholic archdiocese, and after the citizens of Rio de Janeiro petitioned the president, it was finally approved."},
ga5I(){return"The foundation of the statue was ceremoniously laid out to commemorate Brazil\u2019s independence from Portugal."},
ga5J(){return"Construction officially began after the initial design was chosen via a competition and amended by Brazilian artists and engineers."},
ga5K(){return"Construction of the statue was completed, standing 98\u2019 tall with a 92\u2019 wide arm span."},
ga5L(){return"A chapel was consecrated at the statue\u2019s base to Our Lady of Aparecida to mark the statue\u2019s 75th anniversary."},
