gacW(){return"From the heights of these pyramids, forty centuries look down on us."},
gacX(){return"Napoleon Bonaparte"},
gacL(){return"It is theorized the pyramid not only served as a tomb for the pharaoh, but also as a storage pit for various items he would need in the afterlife."},
gacM(){return"The Great Pyramid consists of an estimated 2.3 million blocks. Approximately 5.5 million tonnes of limestone, 8,000 tonnes of granite, and 500,000 tonnes of mortar were used in the construction."},
gad0(){return"\u201cThe Great Pyramids of Giza | Egypt\u2019s Ancient Mysteries | National Geographic UK.\u201d Youtube, uploaded by National Geographic UK."},
gacT(){return"Map showing location of Giza Pyramids in Greater Cairo, Egypt."},
gacP(){return"The Giza pyramid complex, also called the Giza necropolis, is the site on the Giza Plateau in Greater Cairo, Egypt that includes the Great Pyramid of Giza, the Pyramid of Khafre, and the Pyramid of Menkaure, along with their associated pyramid complexes and the Great Sphinx of Giza. All were built during the Fourth Dynasty of the Old Kingdom of Ancient Egypt, between 2600 and 2500 BCE."},
gacQ(){return"The pyramids of Giza and others are thought to have been constructed to house the remains of the deceased pharaohs who ruled over Ancient Egypt. A portion of the pharaoh's spirit called his ka was believed to remain with his corpse. Proper care of the remains was necessary in order for the former Pharaoh to perform his new duties as king of the dead."},
gacN(){return"Most construction theories are based on the idea that the pyramids were built by moving huge stones from a quarry and dragging and lifting them into place. In building the pyramids, the architects might have developed their techniques over time.\nThey would select a site on a relatively flat area of bedrock \u2014 not sand \u2014 which provided a stable foundation. After carefully surveying the site and laying down the first level of stones, they constructed the pyramids in horizontal levels, one on top of the other."},
gacO(){return"For the Great Pyramid, most of the stone for the interior seems to have been quarried immediately to the south of the construction site. The smooth exterior of the pyramid was made of a fine grade of white limestone that was quarried across the Nile.\nTo ensure that the pyramid remained symmetrical, the exterior casing stones all had to be equal in height and width. Workers might have marked all the blocks to indicate the angle of the pyramid wall and trimmed the surfaces carefully so that the blocks fit together. During construction, the outer surface of the stone was smooth limestone; excess stone has eroded as time has passed."},
gacR(){return"The site is at the edges of the Western Desert, approximately 5.6 miles (9 km) west of the Nile River in the city of Giza, and about 8 miles (13 km) southwest of the city center of Cairo."},
gacS(){return"Currently, the pyramids are located in the northwestern side of the Western Desert, and it is considered to be one of the best recognizable and the most visited tourist attractions of the planet."},
gacH(){return"Construction of the 3 pyramids began for three kings of the 4th dynasty; Khufu, Khafre, and Menkaure."},
gacG(){return"Construction began on the smaller surrounding structures called Mastabas for royalty of the 5th and 6th dynasties."},
gacI(){return"Greek Author Herodotus speculated that the pyramids were built in the span of 20 years with over 100,000 slave labourers. This assumption would last for over 1500 years"},
gacD(){return"Tomb of Queen Hetepheres was discovered, containing furniture and jewelry. One of the last remaining treasure-filled tombs after many years of looting and plundering."},
gacE(){return"Designated a UNESCO World Heritage Site to prevent any more unauthorized plundering and vandalism."},
gacF(){return"Discovery of labouror\u2019s districts suggest that the workers building the pyramids were not slaves, and an ingenious building method proved a relatively small work-force was required to build such immense structures."},
