gae9(){return"\u201cIndia\u2019s Taj Mahal Is an Enduring Monument to Love | National Geographic.\u201d Youtube, uploaded by National Geographic."},
gae0(){return"Map showing location of Taj Mahal in Uttar Pradesh, India."},
gadX(){return"The Taj Mahal is an ivory-white marble mausoleum on the right bank of the river Yamuna in the Indian city of Agra. It was commissioned in 1632 CE by the Mughal emperor Shah Jahan (r. 1628-1658) to house the tomb of his favorite wife, Mumtaz Mahal; it also houses the tomb of Shah Jahan himself."},
gadY(){return"The tomb is the centerpiece of a 42-acre (17-hectare) complex, which include twin mosque buildings (placed symmetrically on either side of the mausoleum), a guest house, and is set in formal gardens bounded on three sides by walls."},
gadV(){return"The Taj Mahal was constructed using materials from all over India and Asia. It is believed over 1,000 elephants were used to transport building materials.\nThe translucent white marble was brought from Rajasthan, the jasper from Punjab, jade and crystal from China. The turquoise was from Tibet and the lapis from Afghanistan, while the sapphire came from Sri Lanka. In all, twenty-eight types of precious and semi-precious stones were inlaid into the white marble."},
gadW(){return"An area of roughly 3 acres was excavated, filled with dirt to reduce seepage, and leveled at 160 ft above riverbank. In the tomb area, wells were dug and filled with stone and rubble to form the footings of the tomb.\nThe plinth and tomb took roughly 12 years to complete. The remaining parts of the complex took an additional 10 years."},
gadZ(){return"India's most famed building, it is situated in the eastern part of the city on the southern bank of the Yamuna River, nearly 1 mile east of the Agra Fort, also on the right bank of the Yamuna."},
gae_(){return"The Taj Mahal is built on a parcel of land to the south of the walled city of Agra. Shah Jahan presented Maharaja Jai Singh with a large palace in the center of Agra in exchange for the land."},
gadL(){return"Built by Mughal Emperor Shah Jah\u0101n to immortalize his deceased wife."},
gadM(){return"Construction completed. The project involved over 20,000 workers and spanned 42 acres."},
gadN(){return"There were plans for a second mausoleum for his own remains, but Shah Jah\u0101n was imprisoned by his son for the rest of his life in Agra Fort, and this never came to pass."},
gadO(){return"Lord Curzon and the British Viceroy of India carried out a major restoration to the monument after over 350 years of decay and corrosion due to factory pollution and exhaust."},
gadP(){return"To protect the structure from Sikh militants and some Hindu nationalist groups, night viewing was banned to tourists. This ban would last 20 years."},
gadQ(){return"Restoration and research program put into action to help preserve the monument."},
